    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Bulletin includes a Geologic Map
    of the Green Mountain Anticlinorium in the Vicinity of Rochester and East Middlebury,
    Vermont and a Tectonic map of the Green Mountain Anticlinorium in the Vicinity of
    Rochester and East Middlebury, Vermont. Abstract: The Green Mountain anticlinorium
    was studied in detail in the  northern half of the Rochester quadrangle and in the
    East Middlebury  quadrangle, Vermont. The rocks of this area belong to two Lower
     Paleozoic stratigraphic sequences, contrasting in lithology but more or less equivalent
    in time. Both sequences rest unconformably on the PreCambrian complex.n",nt"license_title":
